// Test stockage
if (msg.from === "brut") {
    flow.set("flux_brut", msg.payload);
    return null;
}


// Test récupération
if (msg.from === "hmac") {

    var fluxBrut = flow.get("flux_brut");

    if (!fluxBrut) {
        return null;
    }

    var conditionOK = (fluxBrut.hmac === msg.payload);

    if (conditionOK) {
        var currentflux = fluxBrut;
        flow.set("flux_brut", null);
        msg.payload = currentflux;
        return msg;
    } else {
        flow.set("flux_brut", null);
        return null;
    }
}

